<template>
	<div style="width: 100%;height: 100%;" ref='header'>
		<div class="img" v-show="activity_id=='dlxk'">
			<img :src='imgUrl' alt="" style="width: 100%;height: 100%;"/>
			<div v-show="page_code!='share'" class="jump" @click="share()" 
				style="position: absolute;right: 10px;top: 20px;width: 15%;text-align: center;">
				<img :src='icon_share_url' alt="" style="width: 60%;height: 60%;"/>
			</div>
			<div id="qrcode" style="position: absolute;bottom: 30px; width: 100%;text-align: center;"></div>
			<i v-show="page_code!='share'" @click="back()" class="fa fa-angle-double-left" style="color: #b1b1b1;position: absolute;bottom: 10px;font-size: 35px;left: 10px;" aria-hidden="true"></i>
		</div>
	</div>
</template>

<script>
	export default {
		name: 'activity',
		data() {
			return {
				activity_id:this.$route.params.id,
				page_code:this.$route.params.code,
				agent_code:this.$route.params.agent,
				imgUrl:'static/img/activity/activity_dlxk_720_1280.jpg',
				icon_share_url:'static/img/activity/icon_share.png',
			}
		},
		mounted() {
			console.log(this.activity_id)
			console.log(this.screenHeight)
			$('.img').css('height',this.screenHeight)
			$('.img').css('overflow','hidden')
			let u = navigator.userAgent;
			let isiOS = !!u.match(/\(i[^;]+;( U;)? CPU.+Mac OS X/);
			if(isiOS) {
				if(screen.height == 812 && screen.width == 375){
					$('.jump').css('top','25px')
				}else {
					$('.jump').css('top','10px')
				}
			}
			console.log(this.screenWidth)
			let qrcode = {}
			if(this.screenWidth >= 375){
				this.imgUrl='static/img/activity/activity_dlxk_750_1334.jpg'
				$('#qrcode').css('bottom','60px')
				qrcode = new QRCode(document.getElementById("qrcode"),{width : 100,height : 100});
			}else{
				this.imgUrl='static/img/activity/activity_dlxk_720_1280.jpg'
				$('#qrcode').css('bottom','40px')
				qrcode = new QRCode(document.getElementById("qrcode"),{width : 80,height : 80});
			}
			qrcode.makeCode('http://bx.caihongh5.com/index.html#/?uid='+this.agent_code);
		},
		destroyed(){
			$('.img').css('overflow','')
		},
		methods: {
			share(){
				let shareLink = 'http://bx.caihongh5.com/index.html#/?uid='+this.agent_code+'&t='+ new Date().getTime()
				console.log("分享地址 ===>" + shareLink)
				Wechat.share({
					message: {
						title: "传递希望 点亮星空",
						description:"光大永明保险点亮星空计划公益活动",
						thumb: "data:image/jpg;base64,",
						mediaTagName:'链接',
						media: {
							type: Wechat.Type.WEBPAGE,
							webpageUrl: shareLink
						}
					},
				scene: Wechat.Scene.SESSION    // share to Timeline
				}, function () {
					//分享成功
				}, function (reason) {
					//分享取消
				});
			}
		}
	}
</script>

